        {props.employees.map((employee) => (
          <EmployeeRecord
            name={employee.name}
            street={employee.street}
            city={employee.city}
            state={employee.state}
            zip={employee.zip}
            month={employee.month}
            day={employee.day}
            year={employee.year}
            position={employee.position}
